import React from "react"
import './App.css';
import * as d3 from "d3";

function drawColorPallet() {
    let colorPallet = ['#191B58', '#FAA68C', '#3C6997', '#5ADBFF', '#050505']
    let svg = d3.select("#color-pallet").append("svg")
        .attr("height", "200px")
        .attr("width", "200px");

    console.warn("select color-pallet =", d3.select("#color-pallet"))

    let rects = svg.selectAll("foo")
        .data(colorPallet)
        .enter()
        .append("rect")
        .attr("x", d=> d.x1)
        .attr("y", d=> d.y1)
        .attr("width", d=> d.x2 - d.x1)
        .attr("height", d=> d.y2 - d.y1)
        .attr("fill", "teal");

    for(let color of colorPallet) {
        console.warn("Hello?", color)
        svg.append("rect").attr("fill", color)
    }
}
function Home(props) {
  return (
  	<div className="container-fluid">
	    <div className="col-6 home-section">
	      <h1>William Vennard</h1>
	      <h2>Web Developer & Mechanical Engineer</h2>
	    </div>
	    <div style={{ 'text-align': 'center', 'margin-bottom': `300px` }}>
	    	<button className="btn btn-outline-dark">Contact Me</button>
	    </div>
	    <div id="color-pallet"></div>
    </div>
  )
}
drawColorPallet()
export default Home;
